import axios from "axios"
import App from './App';

const promise = axios.get("http://localhost:3001/notes")
promise.then(response => {
  cons
})

const promise2 = axios.get("http://localhost:3001/foobar")
console.log(promise2)


const notes = [
  {
    id: 1,
